const item = $input.first().json;

const activeChatbot = item.precompiledData?.customer?.activeChatbot;
const isActive = item.precompiledData?.businessInfo?.isActive;
const isBlacklisted = item.precompiledData?.customer?.isBlacklisted;

return [{
  json: {
    message: "Test successful!",
    debug: {
      activeChatbot: activeChatbot,
      activeChatbotType: typeof activeChatbot,
      isActive: isActive,
      isActiveType: typeof isActive,
      isBlacklisted: isBlacklisted,
      isBlacklistedType: typeof isBlacklisted
    }
  }
}];
